    /**
    @notice Gets the ids of the last sell and buy matching orders.
    @dev iterates over the pair orderbook, simulating the match to obtain the final matching orders
    @return lastBuyMatchId Id of the last Buy order to match
    @return lastSellMatchId Id of the last Sell order to match
  */
    function getLastMatchingOrders(
        Pair storage _self
    ) internal view returns (uint256, uint256) {
        Order memory lastBuyMatch;
        Order memory lastSellMatch;
        uint256 marketPrice = getMarketPrice(_self);
        Order memory buy;
        Order memory sell;

        uint256 lastBuyLimitOrderId;
        uint256 lastBuyMarketOrderId;
        uint256 lastSellLimitOrderId;
        uint256 lastSellMarketOrderId;

        uint256 pricePrecision = _self.priceComparisonPrecision;

        (buy, lastBuyLimitOrderId, lastBuyMarketOrderId) = getNextValidOrderEP(
            _self,
            true,
            lastBuyLimitOrderId,
            lastBuyMarketOrderId
        );
        (
            sell,
            lastSellLimitOrderId,
            lastSellMarketOrderId
        ) = getNextValidOrderEP(
            _self,
            false,
            lastSellLimitOrderId,
            lastSellMarketOrderId
        );

        while (shouldMatchMemory(marketPrice, buy, sell)) {
            lastBuyMatch = buy;
            lastSellMatch = sell;
            (uint256 limitingAmount, MatchType matchType) = compareIntents(
                buy.exchangeableAmount,
                getOrderPrice(marketPrice, buy),
                sell.exchangeableAmount,
                pricePrecision
            );

            if (matchType == MatchType.DOUBLE_FILL) {
                (
                    buy,
                    lastBuyLimitOrderId,
                    lastBuyMarketOrderId
                ) = getNextValidOrderEP(
                    _self,
                    true,
                    lastBuyLimitOrderId,
                    lastBuyMarketOrderId
                );
                (
                    sell,
                    lastSellLimitOrderId,
                    lastSellMarketOrderId
                ) = getNextValidOrderEP(
                    _self,
                    false,
                    lastSellLimitOrderId,
                    lastSellMarketOrderId
                );
            } else if (matchType == MatchType.BUYER_FILL) {
                (
                    buy,
                    lastBuyLimitOrderId,
                    lastBuyMarketOrderId
                ) = getNextValidOrderEP(
                    _self,
                    true,
                    lastBuyLimitOrderId,
                    lastBuyMarketOrderId
                );
                sell.exchangeableAmount = sell.exchangeableAmount.sub(
                    limitingAmount
                );
            } else if (matchType == MatchType.SELLER_FILL) {
                (
                    sell,
                    lastSellLimitOrderId,
                    lastSellMarketOrderId
                ) = getNextValidOrderEP(
                    _self,
                    false,
                    lastSellLimitOrderId,
                    lastSellMarketOrderId
                );
                uint256 moPrice = getOrderPrice(marketPrice, buy);
                uint256 buyerExpectedSend = convertToBase(
                    limitingAmount,
                    moPrice,
                    pricePrecision
                );

                buy.exchangeableAmount = buy.exchangeableAmount.sub(
                    buyerExpectedSend
                );
            } else {
                // TODO
                require(false, "wow this is a bad implementation");
            }
        }

        return (lastBuyMatch.id, lastSellMatch.id);
    }

    function getEmergentPrice(
        Pair storage _self
    )
        public
        view
        returns (
            uint256 emergentPrice,
            uint256 lastBuyMatchId,
            uint256 lastBuyMatchAmount,
            uint256 lastSellMatchId
        )
    {
        (
            uint256 lastBuyMatchedId,
            uint256 lastSellMatchedId
        ) = getLastMatchingOrders(_self);
        Order storage lastBuyMatch = get(
            _self.baseToken.orderbook,
            lastBuyMatchedId
        );
        Order storage lastSellMatch = get(
            _self.secondaryToken.orderbook,
            lastSellMatchedId
        );

        if (lastBuyMatch.id == 0) return (0, 0, 0, 0);
        emergentPrice = Math.average(
            getOrderPrice(getMarketPrice(_self), lastBuyMatch),
            getOrderPrice(getMarketPrice(_self), lastSellMatch)
        );
        return (
            emergentPrice,
            lastBuyMatch.id,
            lastBuyMatch.exchangeableAmount,
            lastSellMatch.id
        );
    }

    function compareIntents(
        uint256 _buyAmount,
        uint256 _buyPrice,
        uint256 _sellAmount,
        uint256 _priceComparisonPrecision
    ) public pure returns (uint256 limitingAmount, MatchType matchType) {
        uint256 buyerIntent = _buyAmount.mul(_priceComparisonPrecision).div(
            _buyPrice
        );
        if (_sellAmount > buyerIntent) {
            return (buyerIntent, MatchType.BUYER_FILL);
        } else if (_sellAmount < buyerIntent) {
            return (_sellAmount, MatchType.SELLER_FILL);
        } else {
            return (_sellAmount, MatchType.DOUBLE_FILL);
        }
    }

