    function getOrderPrice(
        uint256 _marketPrice,
        Order memory _order
    ) private pure returns (uint256) {
        return
            (_order.orderType == OrderType.LIMIT_ORDER)
                ? _order.price
                : marketOrderSpotPrice(_marketPrice, _order.multiplyFactor);
    }

